export function getShowImageUploadDialogAction(){
    return {
        type: SHOW_IMAGE_UPLOAD_DIALOG
    }
}

export function getHideImageUploadDialogAction(){
    return {
        type: HIDE_IMAGE_UPLOAD_DIALOG
    }
}
